import { BrowserRouter, Route, Router, Routes } from 'react-router-dom';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <BrowserRouter>
      <Router>
        <Routes element={<App />}/>
      </Router>
    </BrowserRouter>

  </React.StrictMode>
);

